import axios from 'axios';

const AllProjects = async (username, password) => {
     const response = await axios({
        method: 'post',
        url: 'http://localhost:5000/projects',
        data: {
          username: 'walter.bates',
          password: 'bpm'
        }
      });
      console.log(response);
}

export default AllProjects
